import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-panel-details',
  templateUrl: './panel-details.component.html',
  styleUrls: ['./panel-details.component.css'],
})
export class PanelDetailsComponent {
  @Input() panel: any;
}
<div>
  <h2>Panel Details</h2>
  <ul>
    <li>Parameters: {{ panel.Parameters }}</li>
    <li>R Phase Voltage Status: {{ panel.RPhaseVoltageStatus }}</li>
    <li>MCB Status: {{ panel.MCBStatus }}</li>
    <li>Load Status: {{ panel.LoadStatus }}</li>
    <li>PF Status: {{ panel.PFStatus }}</li>
  </ul>
</div>
